import DirecotryItem from "../directory-item/directory-item.components";
import {DirectoryConatiner} from "./directory.styles";
import { Key } from "react";


export type DirectoryCategory = {
  id: Key;
  title: string;
  imageUrl: string;
  route: string;
};

const categories:DirectoryCategory[] = [
    {
      "id": 1,
      "title": "hats",
      "imageUrl": "https://i.ibb.co/cvpntL1/hats.png",
      "route": "shop/hats"
    },
    {
      "id": 2,
      "title": "jackets",
      "imageUrl": "https://i.ibb.co/px2tCc3/jackets.png",
      "route" : "shop/jackets"
    },
    {
      "id": 3,
      "title": "sneakers",
      "imageUrl": "https://i.ibb.co/0jqHpnp/sneakers.png",
      "route" : "shop/sneakers"
    },
    {
      "id": 4,
      "title": "womens",
      "imageUrl": "https://i.ibb.co/GCCdy8t/womens.png",
      "route" : "shop/womens"
    },
    {
      "id": 5,
      "title": "mens",
      "imageUrl": "https://i.ibb.co/R70vBrQ/men.png",
      "route" : "shop/mens"
    }
  ]
  

function Directory() {
    return(
        <DirectoryConatiner>
            {
            categories.map((category) => (
            <DirecotryItem key={category.id} category={category} />
            ))}
        </DirectoryConatiner>
    );
};

export default Directory;
